/* eslint-disable react/jsx-pascal-case */
import React from 'react'
import Navbar from './Navbar'
import Page_heading from './Blog/Page_heading'
import Blog_page from './Blog/Blog_page'

function Blog() {
  return (
    <div>
       <Navbar/>
       <Page_heading/>
       <Blog_page/>
    </div>
  )
}

export default Blog
